ISLAMABAD, Aug 22 (APP):Director General Strategic Plans Division (SPD) Lt. Gen. Nadeem Zaki Manj Saturday called on Prime Minister Imran Khan.
The DG SPD briefed the prime minister regarding initiatives of the Strategic Plans Division, PM office media wing in a press release said. The prime minister appreciated the role and contribution of SPD.
